      "AvaxFoxes: invalid ether value"
    );

    for (uint i = 0; i < numberOfNfts; i++) {
      _randomMint(msg.sender);
      _splitBalance(msg.value / numberOfNfts);
    }
    uint256 min_minter = 10000;
    uint256 min_minter_adress_index;
    for (uint i = 0; i < 10; i++){
        if(min_minter > mintingPointsOfOwner(mostMinters[i]) ){
            min_minter = mintingPointsOfOwner(mostMinters[i]);
            min_minter_adress_index = i;
        }
    }
    if(mintsCountOfOwner(msg.sender) > min_minter ){
        mostMinters[min_minter_adress_index] = msg.sender;
    }
    
  }
  function pause(bool _state) public onlyOwner {
    paused = _state;
  }
  
  function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
  {
    uint256 ownerTokenCount = balanceOf(_owner);
    uint256[] memory tokenIds = new uint256[](ownerTokenCount);
    for (uint256 i; i < ownerTokenCount; i++) {
      tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
    }
    return tokenIds;
  }
   
   function getMostMinters() public view returns (address[] memory) {
    return  mostMinters;
  }
  function mintingPointsOfOwner(address _owner) public view returns (uint256) {
    uint256 total = 0;
    for (uint256 i; i < minters_adress[_owner].length; i++) {
      total += 1;
      if (tokenOfOwnerByIndex(_owner, i) < 11)
      {
         total += 9;
      }
    }
    return  total;
  }
   function mintsCountOfOwner(address _owner) public view returns (uint256) {
    return  minters_adress[_owner].length;
  }
  
  function mintsOfOwner(address _owner) public view returns (uint256[] memory) {
    return minters_adress[_owner];
  }

  function claimRewards() public {
    uint count = balanceOf(msg.sender);
    uint256 balance = 0;
    for (uint i = 0; i < count; i++) {
      uint tokenId = tokenOfOwnerByIndex(msg.sender, i);
      if (_giveaways[tokenId] != address(0)) continue;
      balance += getReflectionBalance(tokenId);
      lastDividendAt[tokenId] = totalDividend;
    }
    payable(msg.sender).transfer(balance);
  }

  function getReflectionBalances() public view returns (uint256) {
    uint count = balanceOf(msg.sender);
    uint256 total = 0;
    for (uint i = 0; i < count; i++) {
      uint tokenId = tokenOfOwnerByIndex(msg.sender, i);
      if (_giveaways[tokenId] != address(0)) continue;
      total += getReflectionBalance(tokenId);
    }
    return total;
  }

  
  

  function claimReward(uint256 tokenId) public {
    require(
      ownerOf(tokenId) == _msgSender() || getApproved(tokenId) == _msgSender(),
      "AvaxFoxes: Only owner or approved can claim rewards"
    );
    require(
      _giveaways[tokenId] == address(0),
      "AvaxFoxes: can't claim for giveaways"
    );
    uint256 balance = getReflectionBalance(tokenId);
    payable(ownerOf(tokenId)).transfer(balance);
    lastDividendAt[tokenId] = totalDividend;
  }

  function getReflectionBalance(uint256 tokenId) public view returns (uint256) {
    return totalDividend - lastDividendAt[tokenId];
  }

  function _splitBalance(uint256 amount) internal {
    uint256 reflectionShare = (amount * 10) / 100;
    uint256 mintingShare1 = amount - reflectionShare;
    _reflectDividend(reflectionShare);
    payable(_admin).transfer(mintingShare1);
  }

  function _reflectDividend(uint256 amount) internal {
    reflectionBalance = reflectionBalance + amount;
    totalDividend = totalDividend + (amount / totalSupply());
  }

  function _randomMint(address _to) internal returns (uint256) {
    require(totalSupply() < MAX_NFT_SUPPLY, "AvaxFoxes: max supply reached");
    uint256 index = (_getRandom() % pendingCount) + 1;
    uint256 tokenId = _popPendingAtIndex(index);
    _totalSupply += 1;
    minters_adress[msg.sender].push(tokenId) ;
    lastDividendAt[tokenId] = totalDividend;
    _mint(_to, tokenId);

    return tokenId;
  }

  function getPendingIndexById(uint256 tokenId, uint256 startIndex, uint256 totalCount) external view returns (uint256) {
    for (uint256 i = 0; i < totalCount; i++) {
      uint256 pendingTokenId = _getPendingAtIndex(i + startIndex);
      if (pendingTokenId == tokenId) {
        return i + startIndex;
      }
    }
    revert("NFTInitialSeller: invalid token id(pending index)");
  }

  function _getPendingAtIndex(uint256 _index) internal view returns (uint256) {
    return _pendingIds[_index] + _index;
  }

  function _popPendingAtIndex(uint256 _index) internal returns (uint256) {
    uint256 tokenId = _getPendingAtIndex(_index);
    if (_index != pendingCount) {
      uint256 lastPendingId = _getPendingAtIndex(pendingCount);
      _pendingIds[_index] = lastPendingId - _index;
    }
    pendingCount--;
    return tokenId;
  }

  function _getRandom() internal view returns (uint256) {
    return
      uint256(
        keccak256(
          abi.encodePacked(block.difficulty, block.timestamp, pendingCount)
        )
      );
  }
}

